! Note: DEFAULT_TRAP() depends on TRAP_BASE_VA fitting in 32 bits
#define DEFAULT_TRAP(NUM) \
	mov	NUM, %g7; \
	sllx	%g7, 5, %g7; \
	sethi	%lm(TRAP_BASE_VA), %g6; \
	or	%g6, %lo(TRAP_BASE_VA), %g6; \
	jmpl	%g6+%g7, %g0; \
	nop; nop; nop;

#define TRAP_JUMP(ADDR) \
	sethi	%hh(ADDR), %g6; \
	or	%g6, %hm(ADDR), %g6; \
	sethi	%lm(ADDR), %g7; \
	or	%g7, %lo(ADDR), %g7; \
	sllx	%g6, 32, %g6; \
	or	%g6, %g7, %g6; \
	jmpl	%g6, %g0; \
	nop;

