	stxa	%g5, [%g4]ASI_PRIMARY_CONTEXT_REG
	set	ASI_SECONDARY_CONTEXT_1_REG_VAL, %g4
	stxa	%g5, [%g4]ASI_SECONDARY_CONTEXT_REG 
